import React from 'react';
import '../hojas-de-estilo/testimonio.css';


function Testimonio(props) {
  return (
    <div className='contenedor-testimonio'>
      <img className='imagen-t'src={require('../imagenes/persona1.png')}
      alt='foto de emma'/>
      <div className='contenedor-tex'>
        <p className='nombre-tes'>{props.nombre} {props.pais}</p>
        <p className='cargo-tes'>{props.cargo} {props.empresa}</p>
        <p className='texto-tes'> {props.Testimonio} </p>
      </div>
    </div>
  );
}

export default Testimonio;
